import React, { Component } from 'react';
import './Movie.css';

class Movie extends Component {
  render() {
    console.log(this.props)
    return (
      <div >
          <MoviePoster URL = {this.props.poster}/>
      </div>
    );
  }
}

class MoviePoster extends Component{
  render(){
    return (
      <img src = {this.props.URL}/>
    )
  }
}

export default Movie;
